FormScriptItem.Script:
//UpdatePreInspctionStatus
const selectedRows = VV.Form.Global.DatagridFindSelectedRows(
    "DG Regulation Relation"
); // array of form guids
let confirmMessage = "";

if (selectedRows.length > 0) {
    if (selectedRows.length == 1) {
        confirmMessage = `Do you want to ${action.toLowerCase()} the selected Regulation(s)?`;
    } else {
        confirmMessage = `Do you want to ${action.toLowerCase()} the selected Regulation(s)s?`;
    }
    VV.Form.Global.DisplayModal({
        Icon: "question",
        HtmlContent: confirmMessage,
        okFunction: fireWebService,
    });
} else {
    VV.Form.Global.CentralMessages("No Records Selected", {
        action: action.toLowerCase(),
    });
    return; // exit function
}

function fireWebService() {
    let newStatus;

    switch (action.toLowerCase()) {
        case "enable":
            //Statements executed when the result of expression matches enable
            newStatus = "Enabled";
            break;
        case "disable":
            //Statements executed when the result of expression matches disable
            newStatus = "Disabled";
            break;
        default:
            //Statements executed when none of the values match the value of the expression
            let modalContent = `Action must be passed into function.`;
            VV.Form.Global.DisplayModal({
                Title: "Error",
                Icon: "error",
                HtmlContent: modalContent,
            });
    }

    const UpdateObject = {
        Status: newStatus,
    };

    let websvcName = "LibFormUpdateRecords";
    let CallServerSide = function () {
        VV.Form.ShowLoadingPanel();
        let formData = [];

        let FormInfo = {};
        FormInfo.name = "FormGUIDs";
        FormInfo.value = selectedRows;
        formData.push(FormInfo);

        FormInfo = {};
        FormInfo.name = "UpdateObject";
        FormInfo.value = UpdateObject;
        formData.push(FormInfo);

        //Following will prepare the collection and send with call to server side script.
        let data = JSON.stringify(formData);
        let requestObject = $.ajax({
            type: "POST",
            url: `${VV.BaseAppUrl}api/v1/${VV.CustomerAlias}/${VV.CustomerDatabaseAlias}/scripts?name=${websvcName}`,
            contentType: `application/json; charset=utf-8`,
            data: data,
        });

        return requestObject;
    };

    $.when(CallServerSide()).always(function (resp) {
        VV.Form.HideLoadingPanel();
        let messageData = "";
        if (typeof resp.status != "undefined") {
            messageData = `A status code of ${resp.status} returned from the server. There is a communication problem with the web servers. If this continues, please contact the administrator and communicate to them this message and where it occurred.`;
            displayErrorModal(messageData);
        } else if (typeof resp.statusCode != "undefined") {
            messageData = `A status code of ${resp.statusCode} with a message of '${resp.errorMessages[0].message}' returned from the server. This may mean that the servers to run the business logic are not available.`;
            displayErrorModal(messageData);
        } else if (resp.meta.status == "200") {
            if (resp.data[0] != "undefined") {
                if (resp.data[0] == "Success") {
                    VV.Form.RefreshDataGridControl("DG Regulation Relation"); //Refresh the datagrid control
                    VV.Form.Global.DatagridClearSelected("DG Regulation Relation"); //Clear the selected datagrid items
                    let multipleRecords = resp.data[2].length > 1 ? true : false;
                    VV.Form.Global.CentralMessages("Status", {
                        status: newStatus,
                        templateName: "Regulation Relation",
                        multipleRecords: multipleRecords,
                        selection: true,
                    });
                } else if (resp.data[0] == "Error") {
                    messageData = `An error was encountered. ${resp.data[1]}`;
                    displayErrorModal(messageData);
                } else {
                    messageData = `An unhandled response occurred when calling ${websvcName}. The form will not save at this time. Please try again or communicate this issue to support.`;
                    displayErrorModal(messageData);
                }
            } else {
                messageData = "The status of the response returned as undefined.";
                displayErrorModal(messageData);
            }
        } else {
            messageData = `The following unhandled response occurred while attempting to retrieve data from ${websvcName}: ${resp?.data?.error}`;
            displayErrorModal(messageData);
        }
        VV.Form.RefreshDataGridControl("DG Regulation Relation");
    });
}

function displayErrorModal(messageData) {
    VV.Form.Global.DisplayModal({
        Title: "Error",
        Icon: "error",
        HtmlContent: messageData,
    });
}

//Save for Inspection Template

var CallServerSide = function () {
    VV.Form.ShowLoadingPanel();
    //Only necessary fields sent
    var formData = []
  
    var FormInfo = {};
    FormInfo.name = 'REVISIONID';
    FormInfo.value = VV.Form.DataID;
    formData.push(FormInfo);

    var TempName = {};
    TempName.name = 'InspectionTemplateName';
    TempName.value = VV.Form.GetFieldValue('Inspection Template Name');
    formData.push(TempName);

    var LicenseType = {};
    LicenseType.name = 'LicenseType';
    LicenseType.value = VV.Form.GetDropDownListItemValue('License Type');
    formData.push(LicenseType);

    var StartDate = {};
    StartDate.name = 'StartDate';
    StartDate.value = VV.Form.GetFieldValue('Effective Start Date');
    formData.push(StartDate);

    var EndDate = {};
    EndDate.name = 'EndDate';
    EndDate.value = VV.Form.GetFieldValue('Effective End Date');
    formData.push(EndDate);
  
    //Following will prepare the collection and send with call to server side script.
    var data = JSON.stringify(formData);
    var requestObject = $.ajax({
      type: "POST",
      url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=InspectionTemplateSave',
      contentType: "application/json; charset=utf-8",
      data: data,
      success: '',
      error: ''
    });
  
    return requestObject;
  };
  
  
  VV.Form.ShowLoadingPanel();
  
  $.when(
    CallServerSide()
  ).always(function (resp) {
    VV.Form.HideLoadingPanel();
    var messageData = '';
    if (typeof (resp.status) != 'undefined') {
      messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
      V.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
    }
    else if (typeof (resp.statusCode) != 'undefined') {
      messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
      V.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
    }
    else if (resp.meta.status == '200') {
      if (resp.data[0] != undefined) {
        if (resp.data[0] == 'Success') {
          messageData = 'The record has been saved.';
          var title = 'Save Form';
          VV.Form.SetFieldValue('Form Saved', 'True', true)
          VV.Form.ShowLoadingPanel();
          VV.Form.DoAjaxFormSave().then(function (resp) {
            VV.Form.HideLoadingPanel();
            VV.Form.Global.DisplayModal({ Icon: 'success', Title: title, HtmlContent: messageData });
          });
        }
        else if (resp.data[0] == 'Error') {
          messageData = 'An error was encountered. ' + resp.data[1];
          VV.Form.HideLoadingPanel();
          VV.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
        }
        else {
          messageData = 'An unhandled response occurred when calling InspectionTemplateItemSave. The form will not save at this time.  Please try again or communicate this issue to support.';
          VV.Form.HideLoadingPanel();
          VV.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
        }
      }
      else {
        messageData = 'The status of the response returned as undefined.';
        VV.Form.HideLoadingPanel();
        VV.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
      }
    }
    else {
      messageData = "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>';
      VV.Form.HideLoadingPanel();
      VV.Form.Global.DisplayModal({ Icon: 'error', Title: 'Error', HtmlContent: messageData });
    }
  });

