    FormInfo.name = 'FORMID';
    FormInfo.value = VV.Form.GetFieldValue('Form ID');
    formData.push(FormInfo);

    var RegulationInfo = {};
    RegulationInfo.name = 'RegulationDDText';
    RegulationInfo.value = VV.Form.GetDropDownListItemValue('RegulationDD');
    formData.push(RegulationInfo);

    //Following will prepare the collection and send with call to server side script.
    var data = JSON.stringify(formData);
    var requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=InspectionTemplateAddRegulation',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

$.when(
    CallServerSide()
).always(function (resp) {
    var messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
        VV.Form.HideLoadingPanel();
        VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.HideLoadingPanel();
        VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != undefined) {
            if (resp.data[0] == 'Success') {

                VV.Form.DoAjaxFormSave();
                VV.Form.Global.RefreshFormElements()
                VV.Form.HideLoadingPanel();
            }
            else if (resp.data[0] == 'Error') {

                messageData = 'An error was encountered. ' + resp.data[1] + '<br><br>' + 'Please try again or contact a system administrator if this problem continues.';

                VV.Form.HideLoadingPanel();
                VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
            }
            else {
                messageData = 'An unhandled response occurred when calling Add Regulation. Please refresh the page.';
                VV.Form.HideLoadingPanel();
                VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.HideLoadingPanel();
            VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
        }
    }
    else {
        messageData = "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>';
        VV.Form.HideLoadingPanel();
        VV.Form.Global.DisplayModal({ Icon: 'warning', HtmlContent: messageData });
    }
});

// Form Validation for Inspection Template

/* FIELD NAME, VALIDATION TYPE, & EVENT

fieldName | validationType | event
Effective Start Date | Blank | Blur
Effective End Date | Today or after | Blur
License Type | DropDown | Blur
Default Priority | DropDown | Blur
Inspection Template Name | Blank | Blur
Bypass PreInspection | DropDown | Blur
Notify Provider | DropDown | Blur
*/

// Pass in ControlName to validate a single item or nothing to validate everything.
var ErrorReporting = true;

var RunAll = false;
if (ControlName == null) {
    RunAll = true;
}

/*************************************
    BEGIN GENERATED VALIDATION CODE
**************************************/

if (ControlName == 'Form ID' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Form ID'), 'Blank') == false) {
        errorMessage = 'Please complete the Form ID field.';
        VV.Form.SetValidationErrorMessageOnField('Form ID', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Form ID');
    }
}

//VV.Form.Template.FormValidation('Effective Start Date');

//Effective Start Date - Field that must be completed.
if (ControlName == 'Effective Start Date' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Effective Start Date'), 'Blank') == false) {
        const errorMessage = 'The Effective Start Date must be chosen.';
        VV.Form.SetValidationErrorMessageOnField('Effective Start Date', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Effective Start Date');
    }
}


//VV.Form.Template.FormValidation('Effective End Date');

//Effective End Date - Date must be today or after today. Is rechecked when Effective Start Date is checked.
if (ControlName == 'Effective End Date' || ControlName == 'Effective Start Date' || RunAll) {
    let effectiveStartDate = VV.Form.GetFieldValue('Effective Start Date');
    let effectiveEndDate = VV.Form.GetFieldValue('Effective End Date');

    if (VV.Form.Global.CentralDateValidation(effectiveEndDate, 'TodayorAfter') == false) {
        const errorMessage = 'Effective End Date must be today or after today.';
        VV.Form.SetValidationErrorMessageOnField('Effective End Date', errorMessage);
        ErrorReporting = false;
    } else if (VV.Form.Global.CentralDateValidation(effectiveEndDate, 'DateAfter', effectiveStartDate) == false) {
        const errorMessage = 'Effective End Date must be after the Effective Start Date.';
        VV.Form.SetValidationErrorMessageOnField('Effective End Date', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Effective End Date');
    }
}

//VV.Form.Template.FormValidation('License Type');

//License Type - DropDown must be selected.
if (ControlName == 'License Type' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('License Type'), 'DDSelect') == false) {
        const errorMessage = 'Please make a selection from the License Type dropdown.';
        VV.Form.SetValidationErrorMessageOnField('License Type', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('License Type');
    }
}

//VV.Form.Template.FormValidation('Default Priority');

//Default Priority - DropDown must be selected.
if (ControlName == 'Default Priority' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Default Priority'), 'DDSelect') == false) {
        const errorMessage = 'Please make a selection from the Default Priority dropdown.';
        VV.Form.SetValidationErrorMessageOnField('Default Priority', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Default Priority');
    }
}

//VV.Form.Template.FormValidation('Inspection Template Name');

//Inspection Template Name - Field that must be completed. 
if (ControlName == 'Inspection Template Name' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Inspection Template Name'), 'Blank') == false) {
        const errorMessage = 'Please complete the Inspection Template Name field.';
        VV.Form.SetValidationErrorMessageOnField('Inspection Template Name', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Inspection Template Name');
    }
}

//VV.Form.Template.FormValidation('Bypass PreInspection');

//Bypass PreInspection - DropDown must be selected.
if (ControlName == 'Bypass PreInspection' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Bypass PreInspection'), 'DDSelect') == false) {
        const errorMessage = 'Please make a selection from the Bypass PreInspection dropdown.';
        VV.Form.SetValidationErrorMessageOnField('Bypass PreInspection', errorMessage);
        ErrorReporting = false;
    } else if (VV.Form.GetFieldValue('Bypass PreInspection') == 'No' && VV.Form.GetFieldValue('Notify Provider') == 'No') {
        const errorMessage = 'Can Bypass Inspection cannot be No when Notify provider of Schedule is No ecause the pre-inspection phase cannot occur unannounced';
        VV.Form.SetValidationErrorMessageOnField('Bypass PreInspection', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Bypass PreInspection');
        VV.Form.ClearValidationErrorOnField('Notify Provider');
    }
}

//VV.Form.Template.FormValidation('Notify Provider');

//Notify Provider - DropDown must be selected.
if (ControlName == 'Notify Provider' || RunAll) {
    if (VV.Form.Global.CentralValidation(VV.Form.GetFieldValue('Notify Provider'), 'DDSelect') == false) {
        const errorMessage = 'Please make a selection from the Notify Provider dropdown.';
        VV.Form.SetValidationErrorMessageOnField('Notify Provider', errorMessage);
        ErrorReporting = false;
    } else if (VV.Form.GetFieldValue('Bypass PreInspection') == 'No' && VV.Form.GetFieldValue('Notify Provider') == 'No') {
        const errorMessage = 'Can Bypass Inspection cannot be No when Notify provider of Schedule is No ecause the pre-inspection phase cannot occur unannounced';
        VV.Form.SetValidationErrorMessageOnField('Notify Provider', errorMessage);
        ErrorReporting = false;
    } else {
        VV.Form.ClearValidationErrorOnField('Notify Provider');
        VV.Form.ClearValidationErrorOnField('Bypass PreInspection');
    }
}

return ErrorReporting;

